     -           MTR112(1,qud1)*MTR158(neu1,qud1)*neuMass(neu1)*
     -            qudMass(qud1))))

        Cloop(1) = Cloop(1) + tmp99/(T - neuMass(neu1)**2) + 
     -   tmp100/(U - neuMass(neu1)**2)

	end

